import React, { useState } from 'react'
import LoginPage from '../log-in-page/LoginPage';
import SignupPage from '../sign-up-page/SignupPage';
import './login.css'
const Login = () => {

    const [clickStatus, setClickStatus] = useState(false);

    const clickHandler = () => {
        setClickStatus(clickStatus => !clickStatus);
    }

  return (

    <>
    <div className="btn-wrapper">
    <button type="submit" className="btns" id="signup" onClick={clickHandler}>Sign-up</button>
                {clickStatus ? <SignupPage /> : false}
    <button type="submit" className="btns" id="login" onClick={clickHandler}>Log-in</button>
                {clickStatus ? <LoginPage /> : false}
    </div>
    </>
  );
}

export default Login
